using Aplicacion.Integracion.Test.Comun;
using Bogus;
using Cliente.Shared.ComandosDTO;
using Cliente.Shared.EntidadadesDTO;
using Cliente.Shared.Mensajes;
using Shouldly;

namespace Aplicacion.Integracion.Test.Caracteristicas.Escrutinio;

[Collection(nameof(SliceFixture))]
public class SubirImagenEvidenciaTest
{
    private readonly SliceFixture sliceFixture;
    private readonly Faker faker;

    private readonly int tamano = new Faker().Random.Int(1, 1024 * 1024 * 8);
    private readonly string path = $"J{new Faker().Random.Int(1, 1000)}P{new Faker().Random.Int(1, 1000)}";
    private readonly string nombre = new Faker("es_MX").Random.AlphaNumeric(10);
    private readonly string contenido = "";
    private readonly string contenidoError = "";

    public SubirImagenEvidenciaTest(SliceFixture sliceFixture)
    {
        this.sliceFixture = sliceFixture;
        this.faker = new Faker("es_MX");
    }

    [Fact]
    public async Task SubirImagenEvidencia_Exito()
    {
        var comando = new ArchivoComandoDTO()
        {
            Path = path,
            Nombre = nombre,
            Contenido = contenido,
            Tamano = tamano,
        };

        var pathImagen = Path.Combine("uploads", comando.Path, comando.Nombre);

        var sut = await sliceFixture.SendAsync(comando);

        sut.ShouldBeOfType<RespuestaDTO>();
        sut.Mensaje.ShouldBe(pathImagen);
        sut.Estado.ShouldBe(true);
        sut.CantidadCambios.ShouldBe(1);
    }

    [Fact]
    public async Task SubirImagenEvidencia_NoExito()
    {
        var comando = new ArchivoComandoDTO()
        {
            Path = path,
            Nombre = nombre,
            Contenido = contenidoError,
            Tamano = tamano,
        };
        var pathImagen = Path.Combine("uploads", comando.Path, comando.Nombre);


        var sut = await sliceFixture.SendAsync(comando);

        sut.ShouldBeOfType<RespuestaDTO>();
        sut.Mensaje.ShouldBe(MensajesError.MENSAJE_ERROR_IMAGEN_NO_GUARDADA);
        sut.Mensaje.ShouldNotBe(pathImagen);
        sut.Estado.ShouldBe(false);
        sut.CantidadCambios.ShouldBe(0);
    }
}